import { useEffect, useState } from "react";
import "./App.css";

function App() {
  const [solution, setSolution] = useState(null);

  useEffect(() => {
    fetch("http://localhost:3001/solutions")
      .then((res) => res.json())
      .then((json) => {
        console.log(json);
      });
  }, [setSolution]);

  return (
    <div className="App">
      <h1>Wordle</h1>
    </div>
  );
}

export default App;
